import './App.css';
import { Defaultlayout } from './layout/Defaultlayout';
import { Ticket } from './pages/Ticket/ticketpage';
import { Ticketlist } from './pages/Ticketlist/Ticketlist';
import { Addtickets } from './pages/new_tickets/add_tickets';
import Entry from './pages/Entry/entry';
import { Dashbord } from './pages/Dashbord/dashbord';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'; 

function App() {
  return (
    <div className="App">
     <Router>
      <Switch>
        <Route path ='/'> <Entry></Entry></Route>
      <Defaultlayout>
          <Route path='/dashbord'><Dashbord></Dashbord></Route>
          <Route path='/addticket'> <Addtickets></Addtickets></Route>
          <Route path='/tickets'> <Ticketlist></Ticketlist></Route>
          <Route path='/tickets:tid'><Ticket></Ticket></Route>
      </Defaultlayout>
        </Switch> 
      </Router>
    </div>
  );
}

export default App;
